// src/Freelancer/Freelancer.js
import React from 'react';
import { useHistory } from 'react-router-dom';
import './Freelancer.css';

const Freelancer = () => {
  const history = useHistory();

  const handleLogout = () => {
    localStorage.clear();
    history.push('/');
    window.location.reload();
  };

  return (
    <div className="container-fluid">
      <div className="row g-3 mt-3">
        <div className="col-2"></div>
        <div className="col-4">
          <div className="card shadow border-5 rounded-3 text-center">
            <div className="card-body">
              <h5 className="card-title">Bookmark Jobs</h5>
              <p className="card-text">Manage your Bookmarked Jobs</p>
              <button className="btn btn-success" onClick={() => history.push('/freelancer/bmark/job')}>
                Explore Bookmarks
              </button>
            </div>
          </div>
        </div>
        <div className="col-4">
          <div className="card shadow border-5 rounded-3 text-center">
            <div className="card-body">
              <h5 className="card-title">Skills</h5>
              <p className="card-text">Manage your Skills</p>
              <button className="btn btn-primary" onClick={() => history.push('/freelancer/skills')}>
                Explore Skills
              </button>
            </div>
          </div>
        </div>
      </div>
      <div className="row mt-3 text-center">
        <div className="col-4"></div>
        <div className="col-4">
          <button className="btn btn-danger" onClick={handleLogout}>Log Out</button>
        </div>
        <div className="col-4"></div>
      </div>
    </div>
  );
};

export default Freelancer;
